      05/2014 :..... RELEASE.DATE .. PROTECTION .......: Steam
            1 :.......... DISC(S) .. GAME.TYPE ........: Simulation/Strategy


Men of War: Assault Squad 2 features new single player style skirmish
modes that take players from extreme tank combat to deadly sniper stealth
missions. Commanders can now faceoff against opponents on various new
multiplayer 1v1   4v4 maps. To truly bring the battles to life though there
is the new 8v8 game mode designed for huge battles on spectacular maps.

This new Assault Squad game brings significant game engine and visual
improvements as well, with special attention paid to ones that were highly
requested by the players.

Key features:

* advanced multi-core support
* advanced shader technology
* interface and AI improvements, including unit kill counts and squad icon
  information
* new multiplayer interface
* camouflage depending on season
* fully updated inventory items with new graphics and updated vehicles
* sound improvements, including voice acting
* Steam features, including Steam multiplayer, matchmaking, achievements,
  cloud, player statistics, leaderboards, voice chat, Valve anti-cheat,
  friends invite and workshop
* player level up and ranked system
* in-game video recording, and much more.

Installation:

1. Unrar.
2. Burn or mount the image.
3. Install the game.
4. Copy over the cracked content from the /Crack directory on the image to
   your game install directory.
5. Play the game.
6. Support the software developers. If you like this game, BUY IT!

